  return (
    <>
      <div>
        <Header/>
        {/* <MainScreen/> */}
      </div>

      <div className='line'></div>

      <div style={{display:'flex'}}>
        <MainScreen/>
        <Activity/>
      </div>
    </>


  )
}

export default RightScreen
